import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">


        <p>
          Notes coming soon ...
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default App;
